import React from "react";
import styled from "styled-components";

const BodyWraper = styled.div``;

const ImageSliderWrapper = styled.section`
  width: fit-content;
  #temp-main {
    width: 400px;
  }
`;

const Body = () => {
  return (
    <BodyWraper>
      <ImageSliderWrapper>
        <img className="temp-main" src="images/temp_main.jpg" />
        그림!
      </ImageSliderWrapper>
      <section className="steps-container">
        <article className="steps step1"></article>
        <article className="steps step2">색깔3</article>
        <article className="steps step3">색깔5</article>
        <article className="steps step4">색깔6</article>
      </section>
    </BodyWraper>
  );
};

export default Body;
